import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCheckSquare,dashboard,appointment, faCoffee,sitting } from '@fortawesome/fontawesome-free-solid'
import "./sidebar.css"
const Sidebar = () => {
    return (
        <div>
           
        <FontAwesomeIcon icon={dashboard} /> <button >Coffee</button> <br/> <br/>
        <FontAwesomeIcon icon={appointment} /> <button>Coffee</button> <br/> <br/>
        <FontAwesomeIcon icon={sitting} /> <button>Coffee</button> <br/> <br/>
        </div>
    );
};

export default Sidebar;
